    function getNumbers(
        uint input,
        uint length
    ) internal pure returns (Number memory result) {
        if (length == 1) {
            result.d = input;
        } else if (length == 2) {
            result.c = (input / 10);
            result.d = (input % 10);
        } else if (length == 3) {
            result.b = (input / 100);
            result.c = ((input % 100) / 10);
            result.d = (input % 10);
        } else if (length == 4) {
            result.a = (input / 1000);
            result.b = ((input % 1000) / 100);
            result.c = ((input % 100) / 10);
            result.d = (input % 10);
        }
        return result;
    }

